import React, { useState } from 'react';
import { useTheme } from '../../contexts/ThemeContext';

const ThemeSwitcher = ({ className = '' }) => {
  const { currentTheme, switchTheme, availableThemes, themeColors } = useTheme();
  const [isOpen, setIsOpen] = useState(false);

  const themeIcons = {
    cinematic: (
      <svg className="w-5 h-5" fill="none" stroke="currentColor" viewBox="0 0 24 24">
        <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M19 21V5a2 2 0 00-2-2H7a2 2 0 00-2 2v16m14 0h2m-2 0h-5m-9 0H3m2 0h5M9 7h1m-1 4h1m4-4h1m-1 4h1m-5 10v-5a1 1 0 011-1h2a1 1 0 011 1v5m-4 0h4" />
      </svg>
    ),
    logistics: (
      <svg className="w-5 h-5" fill="none" stroke="currentColor" viewBox="0 0 24 24">
        <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M8 7h12m0 0l-4-4m4 4l-4 4m0 6H4m0 0l4 4m-4-4l4-4" />
      </svg>
    ),
    travel: (
      <svg className="w-5 h-5" fill="none" stroke="currentColor" viewBox="0 0 24 24">
        <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 19l9 2-9-18-9 18 9-2zm0 0v-8" />
      </svg>
    )
  };

  return (
    <div className={`relative ${className}`}>
      {/* Theme Switcher Button */}
      <button
        onClick={() => setIsOpen(!isOpen)}
        className="flex items-center gap-2 px-4 py-2 rounded-xl bg-white/90 backdrop-blur-xl border border-white/40 shadow-premium hover:shadow-floating transition-all duration-300 hover:scale-105"
        style={{
          backgroundColor: themeColors.light,
          borderColor: themeColors.primary + '40',
          color: themeColors.dark
        }}
      >
        {themeIcons[currentTheme]}
        <span className="font-semibold text-sm">{themeColors.name}</span>
        <svg 
          className={`w-4 h-4 transition-transform duration-300 ${isOpen ? 'rotate-180' : ''}`} 
          fill="none" 
          stroke="currentColor" 
          viewBox="0 0 24 24"
        >
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M19 9l-7 7-7-7" />
        </svg>
      </button>

      {/* Theme Dropdown */}
      {isOpen && (
        <div className="absolute top-full left-0 mt-2 w-48 bg-white/95 backdrop-blur-xl rounded-2xl border border-white/40 shadow-elevated overflow-hidden z-50">
          {availableThemes.map((theme) => (
            <button
              key={theme}
              onClick={() => {
                switchTheme(theme);
                setIsOpen(false);
              }}
              className={`w-full flex items-center gap-3 px-4 py-3 text-left transition-all duration-300 hover:scale-105 ${
                currentTheme === theme ? 'bg-opacity-20' : 'hover:bg-opacity-10'
              }`}
              style={{
                backgroundColor: currentTheme === theme ? themeColors.primary + '20' : 'transparent',
                color: themeColors.dark
              }}
            >
              <div 
                className="w-8 h-8 rounded-lg flex items-center justify-center"
                style={{ backgroundColor: themeColors[theme].primary + '20' }}
              >
                {themeIcons[theme]}
              </div>
              <div>
                <div className="font-semibold text-sm">{themeColors[theme].name}</div>
                <div className="text-xs opacity-70">
                  {theme === 'cinematic' && 'Corporate Theme'}
                  {theme === 'logistics' && 'Logistics Theme'}
                  {theme === 'travel' && 'Travel Theme'}
                </div>
              </div>
              {currentTheme === theme && (
                <div className="ml-auto">
                  <svg className="w-4 h-4" fill="currentColor" viewBox="0 0 20 20">
                    <path fillRule="evenodd" d="M16.707 5.293a1 1 0 010 1.414l-8 8a1 1 0 01-1.414 0l-4-4a1 1 0 011.414-1.414L8 12.586l7.293-7.293a1 1 0 011.414 0z" clipRule="evenodd" />
                  </svg>
                </div>
              )}
            </button>
          ))}
        </div>
      )}

      {/* Backdrop */}
      {isOpen && (
        <div 
          className="fixed inset-0 z-40" 
          onClick={() => setIsOpen(false)}
        />
      )}
    </div>
  );
};

export default ThemeSwitcher;
